description:
The Alex Jones Show

Thursday February 26th, 2009.


Hour-1: News and rants
Hour-2: Open lines and Cele Castillo
Hour-3: Cele Castillo, Rep. Charles Key, open lines, Christian J. Pinto and David Bay
Hour-4: Christian J. Pinto and David Bay


Alex talks with Christian J. Pinto, director, and David Bay, producer, of the documentary Secret Mysteries of America's Beginnings and Eye Of The Phoenix. Alex also talks with Oklahoma Rep. Charles Key about House Joint Resolution 1089, a resolution claiming sovereignty under the Tenth Amendment to the Constitution and retired DEA agent and whistleblower Cele Castillo. Alex also talks about the issues of the day and takes your calls.



